import React from 'react';
import ContainerResource from "../../Components/Resource/ContainerResource";
import backgroundImage from '../../Assets/Image/Header/header.png';
import imageCenter from '../../Assets/Image/Header/centre.gif';
import headerLeft from '../../Assets/Image/Header/headerLeft.gif';

const HeaderResource = () => {
    return (

        <div className={"containerHeaderResource"}>
            <ContainerResource
                backgroundImage={backgroundImage}
                imageCenter={imageCenter}
                headerLeft={headerLeft}
            />
        </div>

    );
};

export default HeaderResource;
